import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Navbar = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <header style={styles.header}>
      <h1 style={styles.logo}>Event Portal</h1>
      <nav style={styles.nav}>
        <Link to="/" style={styles.navLink}>Home</Link>
        <Link to="/events" style={styles.navLink}>Events</Link>
        <Link to="/my-registrations" style={styles.navLink}>My Registrations</Link>
        {user?.role === 'admin' && (
          <Link to="/admin/events" style={styles.navLink}>Admin</Link>
        )}
        <Link to="/profile" style={styles.navLink}>Profile</Link>
        <Link to="/contact" style={styles.navLink}>Contact</Link>
        <button onClick={handleLogout} style={styles.logoutButton}>
          Logout
        </button>
      </nav>
    </header>
  );
};

const styles = {
  header: {
    padding: '20px 40px',
    background: 'rgba(0,0,0,0.2)',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    fontSize: '28px',
    fontWeight: 'bold',
    color: '#fff',
    margin: 0,
  },
  nav: {
    display: 'flex',
    alignItems: 'center',
    gap: '20px',
  },
  navLink: {
    textDecoration: 'none',
    color: '#fff',
    fontWeight: '500',
    transition: 'color 0.3s',
  },
  logoutButton: {
    background: 'transparent',
    border: '1px solid #fff',
    color: '#fff',
    padding: '8px 16px',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

export default Navbar;
